  thickness of fine-grained deposit, and skeletal elastic storage arrays of the SUB
  package of the Central Valley Hydrologic Model\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  37,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2013-03-15T21:16:36.780204\",\n\t\"name\": \"critical-head-thickness-of-fine-grained-deposit-and-skeletal-elastic-storage-arrays-of-the-sub-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This digital dataset defines the SUB package
  arrays for the model grid, critical head, thickness of fine-grained deposits, and
  skeletal-elastic-storage used in the transient hydrologic model of the Central Valley
  flow system. The Central Valley encompasses an approximate 50,000 square-kilometer
  region of California. The complex hydrologic system of the Central Valley is simulated
  using the USGS numerical modeling code MODFLOW-FMP (Schmid 2006b). This simulation
  is referred to here as the Central Valley Hydrologic Model (CVHM) (Faunt, 2009).
  Utilizing MODFLOW-FMP, the CVHM simulates groundwater- and surface-water flow, irrigated
  agriculture, land subsidence, and other key processes in the Central Valley on a
  monthly basis from 1961-2003. The total active modeled area is 20,334 square-miles
  on a finite-difference grid comprising 441 rows and 98 columns. Slightly less than
  50 percent of the cells are active. The CVHM model grid has a uniform horizontal
  discretization of 1x1 square mile and is oriented parallel to the valley axis, 34
  degrees west of north (Faunt, 2009). Both the elastic and inelastic components of
  skeletal specific storage (Ssf) were simulated with the SUB package. The elastic
  and inelastic skeletal storage coefficients were calculated as the product of the
  estimated elastic- and inelastic-specific storage values for coarse- and fine-grained
  materials and the aggregate thicknesses of those materials in each cell. The elastic
  skeletal storage coefficient of the coarse-grained deposits was estimated from the
  product of the aggregate thickness of coarse-grained deposits and the difference
  between estimated elastic-specific storage and the specific storage representing
  the compressibility of water (Hanson, 1988; Faunt, 2009). Critical head is another
  parameter used by the SUB package that strongly affects storage changes, particularly
  the timing of those changes. Critical head is the equivalent head at which effective
  or intergranular stress is equal to the pre-consolidation stress (Faunt, 2009).
  The equivalent critical head, or preconsolidation stress, represents the threshold
  stress that determines whether changes in stress deform the granular skeleton elastically
  or inelastically. For head changes (whether positive or negative) in the range of
  heads greater than the critical head, the skeleton deforms elastically. For head
  changes in the range of heads less than the critical head, the mode of skeletal
  deformation depends on the sense of the head change--a positive change (head increase)
  causes elastic deformation, and a negative change (head decrease) causes inelastic
  deformation and re-establishes a new critical head. In the upper three model layers,
  specified initial critical-head values were equal to the water levels estimated
  for the spring of 1961 (starting head values used in CVHM). In the lower seven model
  layers, the initial critical heads initially were derived from those estimated by
  Williamson and others (1989). These heads are approximate and were interpolated
  from the minimum historical head values simulated in the CV-RASA model. In the final
  calibration, specified initial critical heads were equal to the head simulated in
  CVHM in September 1961. These values approximate the minimum historical head value
  in 1961 (Faunt, 2009).The CVHM is the most recent regional-scale model of the Central
  Valley developed by the U.S. Geological Survey (USGS). The CVHM was developed as
  part of the USGS Groundwater Resources Program (see \"Foreword\", Chapter A, page
  iii, for details).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
